import { data } from "jquery";

const Main = (props) => {
    const {mobileData} = props;
    console.log(mobileData)
    return (
        <div>
            {
                mobileData.map(
                    function (data) {
                        return (<div>
                            <h1>{data.bank}</h1>
                        </div>
                        )
                    }
                )
            }
        </div>

    )
}
export default Main
